INSERT INTO `exercies` (`e_name`, `e_video_path`, `e_content`, `e_type`, `calories_per_hour`) VALUES ('Band-assisted pull-up',NULL,'The band-assisted pull-up is a variation of the pull-up exercise in which the reps are performed with an elastic band looped around the feet or knees. This reduces weight and resistance at the bottom of the rep, while increasing it toward the top. Like other pull-up variations, it builds strength and muscle in the upper back, biceps, and core, and is often used as a way to help people boost their pull-up numbers or perform their first rep.','Strength',7.6),('Incline dumbbell biceps curl',NULL,'The incline dumbbell biceps curl is an exercise targeting the biceps and performed face up on an incline bench. This creates a vertical arm angle, which helps to isolate the biceps and limit involvement of the shoulder muscles. This curl variation is usually performed for moderate to high reps, such as 8-12 reps per set or more, as part of upper-body or arm-focused training.','Strength',4.5),('Single-leg depth squat',NULL,'The single-leg depth squat is an exercise targeting the muscles of the lower body, including the quads, glutes, and hamstrings. It is sometimes used as a substitute for the pistol squat, since it doesn\'t demand the same level of flexibility to perform. It is usually performed for low to moderate reps with a focus on proper form and control.','Strength',9);
