INSERT INTO `recipe` (`recipecode`, `foodname`, `recipe_title`, `recipe_url`, `recipe_seq`, `recipe_img`) VALUES (6841156,NULL,'다이어트를 결심한 당신에게, “닭가슴살 부추냉채무침”','https://www.10000recipe.com/recipe/6841156','오이(1/2), 양파(1/2), 당근(1/5)을 먹기좋게 썰어 믹싱볼에 담는다|| 부추(10뿌리), 파프리카(1/4) 썰어넣은 후, 닭가슴살(1캔)을 통째로 믹싱볼에 넣는다.|| 양념으로 다진마늘(1큰술), 설탕(2큰술), 매실청(3큰술), 간장(1큰술), 식초(3큰술), 연겨자(1큰술), 레몬(1/2) 즙을 넣고 잘 버무려줍니다.|| 무친 닭가슴살과 채소, 양념을 접시에 담아낸다.','https://recipe1.ezmember.co.kr/cache/recipe/2016/01/06/9e764e8107a194b7f809eab156b5207e1.jpg'),(6854799,NULL,'닭가슴살 갈비구이','https://www.10000recipe.com/recipe/6854799','간장2T, 설탕1T, 참기름0.5T, 다진마늘0.5T, 꿀1T를 넣고 갈비양념을 만들어줍니다 (꿀이 없다면 조청이나 올리고당으로 대체 가능합니다)|| 대파는 길게 채썰어주세요|| 닭가슴살은 얇게 편 썰어주세요|| 볼에 닭가슴살 편 썬걸 담고, 갈비양념을 넣고 양념을 골고루 묻혀 주세요|| 갈비양념을 고루 묻힌 닭가슴살을 냉장고에서 20분정도 숙성시켜줍니다|| 프라이팬에 올리브오일을 살짝 두르고 닭가슴살을 구워줍니다|| 앞뒤로 노릇노릇하게 구워주세요|| 접시에 닭가슴살 갈비구이를 예쁘게 놓고, 대파 썬것도 올려줍니다-파채와 닭가슴살을 곁들여 드시면 됩니다','https://recipe1.ezmember.co.kr/cache/recipe/2016/08/17/d9bdc5d413a5ecac7a8f8ff8ce8edf0b1.jpg'),(6887226,NULL,'저칼로리 된장 참치 양배추롤 만들기 w. 한길식품','https://www.10000recipe.com/recipe/6887226','양배추는 단단한 심지를 잘라내고 흐르는 물에 잘 씻어주세요|| 찜기에 쪄도 되지만 저는 간단하게 비닐봉지에 씻은 물기가 있는 양배추를 넣어-5분 돌려주었어요-말랑말랑하게 익으면 꺼내서 식혀주세요|| 양파, 애호박, 버섯, 쪽파는 잘게 썰어 준비하고 참치는 기름을 쪽 빼주세요|| 팬에 기름을 살짝 두르고 양파, 애호박을 넣어 볶아주세요|| 양파가 투명해지면 버섯을 넣어 볶아주세요|| 야채들이 볶아지면 고추장, 된장, 다진마늘, 물을 넣어 끓여주세요|| 일반 된장의 반 정도만 넣어도 충분히 깊은 맛이 우러나온답니다 1t넣습니다.|| 보글보글 끓어 어느 정도 졸여주세요|| 어느 정도 졸아들면 참치를 넣고 볶아주세요|| 마지막으로 쪽파를 넣어 살짝만 버무리면 된장 참치 속(?) 완성입니다|| 식은 양배추를 세로로 겹겹이 쌓아 넓게 펴주세요|| 만들어 둔 참치 속을 듬뿍 넣어주세요|| 끝에서부터 돌돌 조심히 말아주세요|| 칼로 슥슥 잘라준 뒤 접시에 플레이팅해주면 됩니다|| 영양소 골고루 갖춘 저칼로리 참치 양배추쌈 만들기 완성','https://recipe1.ezmember.co.kr/cache/recipe/2018/04/13/99c90fd70d5491753df543c6a7ed56d91.jpg'),(6890777,NULL,'매콤한 두부덮밥, 눈 깜짝할 새 완성되는 초간단 덮밥요리','https://www.10000recipe.com/recipe/6890777','[재료 준비]-먼저 두부는 키친타월이나 면포를 이용해 물기를 뺀 뒤 으깨서 준비해주시고요.|| 대파는 송송 썰어줍니다.|| [고추장 양념 볶기]-냄비에 들기름 1.5 큰 술, 고추장 4 큰 술, 다진 마늘 1 큰 술, 올리고당 2 큰 술, 미림 1 큰 술, 후춧가루 적당량을 넣고 약불에서 5분 정도 끓여주시고요.-* 올리고당 양은 각자 입맛에 맞게 조절해주세요 ^^|| 볶은 고추장 양념에 으깬 두부와 대파를 넣고 가볍게 볶아줍니다. (이때도 마찬가지로 약불!)-대파의 숨이 죽으면 가스불을 끈 뒤 통깨를 샤샥 뿌려 마무리해주세요.|| 그릇에 밥 한 공기 퍼 담고, 매콤하게 볶은 두부양념을 적당히 올려준 다음 계란 반숙 하나 탁 올려주면 초간단 덮밥요리, 매콤한 두부덮밥 완성!','https://recipe1.ezmember.co.kr/cache/recipe/2018/06/12/4c62616ec005976375e1262e0831adb51.jpg'),(6891823,NULL,'여름에 잘 어울리는 미역초샐러드! 와사비 넣어 더 상큼하게','https://www.10000recipe.com/recipe/6891823','오이는 굵은 소금을 발라 깨끗이 씻어주고 냉동새우살은 물에 담가 해동해주세요 미역은 자른 미역으로 준비해요|| 양파는 최대한 얇게 썰어주시고-오이는 반달모양으로 썰어주세요-양파는 찬물+식초 두2~3방울에 담가 아린맛을 제거해주는게 좋습니다|| 미역을 물에 불려줍니다|| 해동한 냉동새우살은 맛술(미림)을 살짝 둘러주어 비린맛을 없애주세요|| 새우살을 2~3분간 데쳐주고|| 불린 미역도 2분 정도 데쳐-찬물에 헹구워줍니다|| 간장5스푼, 물 5스푼, 식초 3스푼, 설탕1스푼에 와사비를 취향껏 넣어 드레싱을 만들어 줍니다|| 준비된 재료들을 한데 넣고-드레싱을 부어가며 버무려주면 완성!-접시에 낼땐 통깨를 뿌려주세요','https://recipe1.ezmember.co.kr/cache/recipe/2018/07/02/c266461ad4b7032df19bd38c25b9cd441.jpg'),(6895591,NULL,'쫄깃하고 맛있는 두부볶음 레시피!다이어트 요리로도 좋아요','https://www.10000recipe.com/recipe/6895591','먼저 두부는 얇은 두께로 썰어주시구요. 키친타올로 물기를 꾹꾹 눌러 제거해 줍니다.-두부는 찌개용이 아닌 단단한 부침용을 사용하세요|| 달궈진 팬에 기름을 두르신 후 중불에서 노릇노릇 구워 줍니다.조금 바짝 구워주셔야 고기같은 쫄깃한 식감이 됩니다.|| 두부가 다 구워지면 팬에 기름 약간 두르고 다진마늘 1T를 약불에서 살짝 볶아 줍니다.-약불-T:성인 숟가락 기준|| 마늘이 약간 갈색빛이 나면 바로 물 3스푼을 부어 주세요|| 참기름과 깨를 제외한 모든 양념을 넣고 약불에서 한소금 끓여 줍니다.|| 끓여진 양념에 구운 두부를 넣고 볶아주다가 참기름과 깨를 넣고 마무리 합니다!-이때 매콤한 것 좋아하심 청양고추를넣어 주셔요!|| 고기처럼 쫄깃쫄깃 맛있는 두부볶음 완성이에요|| 뜨끈한 밥에 올려 먹어보니 쫄깃한 식감에 매콤달콤 양념이 어우려져 참 맛있어요! 다이어트 중에도 맛있게 즐길수 있는 반찬인듯 합니다!','https://recipe1.ezmember.co.kr/cache/recipe/2018/09/10/52e034a51820107820b9e3aba28717bd1.jpg'),(6909570,NULL,'기름 없이 볶아 다이어트에 좋은 중국식 청경채 돼지볶음','https://www.10000recipe.com/recipe/6909570','재료를 준비해주세요.|| 돼지 앞다리살 200g|| 잡채용 처럼 길게 썰어 주세요.|| 파프리카도 길쭉하게~|| 청경채는 꼭지만 잘라 주세요.|| 간장 2스푼|| 굴소스 1스푼|| 올리고당(설탕) 2스푼|| 다진마늘 1스푼|| 후추 조금|| 밀가루 1스푼|| 잘 섞어주세요.|| 먼저 돼지고기를 수분이 없을 정도로 볶아주세요.|| 양념을 넣어주세요.|| 청경채, 파프리카를 넣어주세요.|| 청경채 숨이 죽을 정도로만 볶아 주세요.|| 기름없이 담백한 중국식 청경채 돼지 볶음 완성입니다.|| 총 509kcal|| 맛있게 드시고 다이어트 성공하세요.','https://recipe1.ezmember.co.kr/cache/recipe/2019/04/14/67b39b7159fa14c51042fe0674e7399f1.jpg'),(6913806,NULL,'♥[신혼밥상] 닭가슴살양배추말이','https://www.10000recipe.com/recipe/6913806','양배추, 당근, 오이를 깨끗하게 씻어주세요.-파프리카나 양배추를 채썰어 사용해도 좋아요.-즐겨먹는 야채 듬뿍듬뿍!|| 양배추가 너무 흐물흐물 거리지 않도록-약 7분~10분정도 쪄줍니다.-아삭함이 조금 사라질 만큼 돌돌 잘 말릴 정도로만 찌기!|| 양배추가 익는동안 오이랑 당근은 채를 썰어 준비.|| 먹을 수 있는 만큼 양배추 잎을 한장한장 떼어주세요.-남은 양배추는 된장에 밥이랑 싸드셔도 좋아요.-일명 양배추쌈밥 추천!|| 양배추 잎에 오이, 당근, 닭가슴살을 올려 돌돌돌 말아주세요.|| 먹기 좋은 크기로 잘라주세요.|| 요즘은 양배추가 달아서 그냥 드셔도 좋겠지만,-야채만 먹기 거북하다면 칠리소스에 살짝 찍어 냠냠!-모두 건강한 S라인 만들기 성공하세요 ♡~','https://recipe1.ezmember.co.kr/cache/recipe/2019/06/16/943ecafd5e928849983cb52d8273e5021.jpg'),(6922742,NULL,'다이어터들의 영양간식!두부참치스테이크 만들기!','https://www.10000recipe.com/recipe/6922742','달걀이 누락되었지만 기본 재료를 준비해요.|| 참치에 기름을 90%버리고 넣어주시고 으깬 두부와 계란, 다진 파, 달걀2개, 소금0.5T, 후추, 부침가루를 4T넣어주세요.|| 간이 뭉치지 않게 잘 섞어주세요.|| 사진과 같이 동그랗게 만들어주세요.(총8개가 나와서 6개는 냉동실에 얼려서 보관해서 나중에 먹어도 되요.)|| 기름 두르고 맛있게 구워줍시다.','https://recipe1.ezmember.co.kr/cache/recipe/2019/11/27/c606469ca6b42e164619d81e1e38cf261.jpg'),(6924130,NULL,'쉽고간단한 시금치양파계란볶음!','https://www.10000recipe.com/recipe/6924130','시금치한줌을 작은크기로 잘라주세요|| 양파 반개를 작게 썰어주세요|| 계란 3개를 깨서 잘섞어두세요|| 팬에 올리브유2큰술을 넣어주세요|| 시금치자른것과 양파자른것을 볶아주세요-*가스불은 중불입니다|| 양파가 투명해지면 풀어둔 계란물을 가운데쪽으로 부어주시고 소금 1작은술을 고루 뿌려주시고 살살 섞어가면서 볶아주세요|| 계란물이 익을정도로만 휘리릭 볶아주시고 통깨를 뿌려주시면 완성이네요|| 쉽고간단하게 만들수있지만 영양만점인 시금치양파계란볶음이 완성이 되었어요-바쁜아침식사대용이나 다이어트식에도 좋고 아이들반찬으로도 좋아요','https://recipe1.ezmember.co.kr/cache/recipe/2019/12/27/258f7b445277ce15104c5a59ca2563501.jpg'),(6939082,NULL,'면두부 새우오일파스타 다이어트에도 좋아요','https://www.10000recipe.com/recipe/6939082','면두부|| 새우 6마리 (요것도 코스트코 냉동새우)|| 마늘은 편마늘로 준비합니다.|| 팬에 올리브오일 넉넉히 두르고-편마늘 넣어서 노릇하게 볶아질때쯤|| 새우를 넣고 함께 볶아줍니다.-이때 소금과 후추를 촥촥 뿌려줍니다.|| 새우가 어느정도 익었을때쯤-마지막에 면두부를 넣고 살짝 볶아주기만하면|| 면두부 새우오일파스타 완성입니다.|| 꼬독꼬독한 식감에 고소함이 더해진-면두부 새우오일파스타 다이어트에도 좋은거같아요 ^^','https://recipe1.ezmember.co.kr/cache/recipe/2020/08/12/8c8087677ac5f71ffb80fa9d4241c6c11.jpg'),(6943349,NULL,'★쫀득쫀득 새우어묵★ 새우와 야채만 들어간 새우어묵입니다~','https://www.10000recipe.com/recipe/6943349','당근은 다져주세요|| 매운고추(주황)도 다져주세요-색깔을 맞추기위해 주황색 청양고추를 사용했습니다 다른것도 무방해요|| 새우도 다져주세요|| 볼에 새우 당근 고추 전분 소금 후추를 넣고 버무려주세요-전분은 소량으로 넣을수록 좋아요~|| 새우반죽을 랩위에 놓고 펼쳐주세요|| 돌돌 말아서 탱탱하게 모양을 잡아주세요|| 찜기에 넣고 약 15분정도 찌면 완성입니다~|| 모양대로 썰어주세요~|| 기호에따라 케첩이나 머스타드 소스를 첨가하여 드시면 더욱 맛있습니다~|| 맛있게드세요~','https://recipe1.ezmember.co.kr/cache/recipe/2020/10/04/d49e1d923c61e71a834cae1a9a5288ce1.jpg'),(6953539,NULL,'빵 대신 에그번 ♥ 햄버거로 다이어트 가능한 \" 달걀버거 \" 만들기','https://www.10000recipe.com/recipe/6953539','달걀은 물에 소금, 식초를 넣고 15분간 삶는다.|| 삶은 달걀은 찬물에 담가 껍질을 벗긴다.|| 방울토마토는 슬라이스하고 슬라이스치즈는 한 입 크기로 썬다.|| 삶은 달걀을 2등분 한다.-다이어트식으로 드실 경우 소스를 빼주세요.|| 달걀>샐러드채소>토마토>슬라이스치즈>슬라이스햄> 스리라차소스>달걀 순으로 올린 뒤 꼬지를 꽂아 완성한다.-꼬지','https://recipe1.ezmember.co.kr/cache/recipe/2021/02/16/61153bf7816901787cdb5558a3d8e1801.jpg'),(6956954,NULL,'[다이어트요리] 에어프라이어에 맛있게 구운 \"닭가슴살꼬치\"♪','https://www.10000recipe.com/recipe/6956954','생닭가슴살을 준비해주세요~-냉동실에 넣어뒀던 거라면 전날 미리 냉장고에 넣어서 자연해동을 추천드려요.|| 사방 3cm크기 정도로 깍둑썰기 해주고요~|| 닭꼬치에 같이 곁들여줄 양파와 파프리카도 닭가슴살과 비슷한 크기로 썰어줍니다.-채소는 좋아하시는 걸로 취향껏 변경가능해요.|| 대나무꼬치를 준비, 닭가슴살-양파-빨강파프리카-닭가슴살-양파-노랑파프리카-닭가슴살-양파-노랑파프리카-닭가슴살 순서로 차곡차곡 끼워주세요.|| 닭가슴살 300g 분량이면 15cm 대나무꼬치 기준으로 7개가 나와요.|| 꼬치를 끼운 후 허브솔트를 뿌려서 밑간해주고요~|| 이후 밑간이 스며들 수 있도록 10여분간 그대로 놔둡니다. 그리고 식용유도 조금씩 발라주고요~|| 에어프라이어 오븐 안에 닭가슴살 꼬치를 넣어주세요.|| 에어프라이어 온도 설정은 180도에 10분으로 해서 먼저 돌려주세요.-에어프라이어|| 10분 뒤에 노릇해지면 뒤집어서 추가로 5분을 더 돌려주세요.|| 180도에 10분, 뒤집고 5분!! 이렇게 하면 전체적으로 잘 익은 닭가슴살꼬치가 완성된답니다.|| 접시에 담아내고 맛있게 먹어주기^^','https://recipe1.ezmember.co.kr/cache/recipe/2021/04/17/7ef6c26cf34b49f7f298ed22fab485b81.jpg'),(6959420,NULL,'톡 쏘는 맛이 매력인 새콤달콤 닭고기 냉채 : 더워서 입맛 없을 때 무조건 이 메뉴!','https://www.10000recipe.com/recipe/6959420','닭고기는 7~8분간 끓는 물에 삶아주세요.-저는 냉장 안심을 사용해서 잡내 제거를 별도로 하지 않아도 됐지만, 닭 냄새에 민감하시다면 소주 1숟갈 넣고 끓여주세요.|| 닭고기가 익는 동안 채소를 썰어주세요.-양배추, 파프리카 모두 채썰어주세요.|| 냉채 소스를 만들어주세요.-(연겨자 0.5+간장1+식초1+물1+매실청1+꿀1+깨소금1+다진마늘 0.5)-연겨자의 톡 쏘는 맛이 힘드신 분은 양을 조금 줄여주세요.|| 잘 익은 닭고기는 잘게 찢어주세요.|| 겨자 드레싱을 뿌린 샐러드 맛있게 드세요:)','https://recipe1.ezmember.co.kr/cache/recipe/2021/05/20/e8b97435ea177a627fc46312cd6c9f501.jpg'),(6962486,NULL,'[다이어트요리] 새싹 두부 비빔밥 만드는 법','https://www.10000recipe.com/recipe/6962486','참깨 1작은술, 매실액 1작은술, 꿀 1작은술, 참기름 1작은술, 고추장 1큰술, 다진 마늘 1작은술을 섞어 고추장양념장을 만듭니다.-참깨1작은술, 매실액1작은술, 꿀1작은술, 참기름1작은술, 고추장1큰술, 다진마늘1작은술|| 두부는 살짝 데친 후 칼로 으깨줍니다.-두부100g|| 새싹채소를 깨끗이 씻은 후 물기를 빼줍니다.-새싹채소50g|| 현미밥 위에 물기 뺀 새싹채소를 올려줍니다.-현미밥2/3공기|| 새싹채소 위에 으깬 두부를 얹어줍니다.|| 고추장 양념장을 곁들입니다.','https://recipe1.ezmember.co.kr/cache/recipe/2021/07/29/5164c0264924697500f2c0906dbab0101.jpg'),(6966445,NULL,'파프리카달걀볶음:초간단 저탄고지 다이어트 단백질식사','https://www.10000recipe.com/recipe/6966445','파프리카와 양파는 한입 크기로 썬다.|| 달걀은 풀어준다.-달걀에 물/육수/우유 등을 넣어주어도 돼요.|| 팬에 현미유 두르고 달걀물 붓고 소금, 후추 조금씩만 넣는다.-약불-현미유 대신 올리브오일 괜찮아요.|| 스크램블에그를 만들고 파프리카와 양파를 볶는다.-스크램블에그는 80%정도만 익혀 따로 덜어두세요. 파프리카와 양파를 먼저 볶은 후 스크램블을 해도 돼요.|| 다시 스크램블에그를 담고 파프리카볶음과 합체시켜 볶는다.|| 파슬리가루를 뿌린다.','https://recipe1.ezmember.co.kr/cache/recipe/2021/10/06/36cb806316fc9049dfe091d61f9f5bd21.jpg'),(6975337,NULL,'순두부찜 (다이어트음식에 아주 좋은 순두부요리)','https://www.10000recipe.com/recipe/6975337','홍고추 1개와 대파 1/2대는 잘게 다져준다|| 간장양념에 다진 대파와 홍고추를 넣고 섞어 양념장을 만들어 준다|| 음식을 담을 그릇에 순두부를 올리고 먹기 좋은 두께로 썰어준다|| 간장양념장을 위에 골고루 뿌려준다|| 랩을 싸서 전자렌지에 넣고 2~3분 가량 데워준다-전자레인지-꼭 찜용으로 안 먹어도 좋다-취향에 맞게 그냥 양념장 올려 먹어도 좋다','https://recipe1.ezmember.co.kr/cache/recipe/2022/03/02/6b7004cb211e4a6e2e737a82efda24d21.jpg'),(6981985,NULL,'다이어트 식단 브로콜리 두부무침 만드는 법','https://www.10000recipe.com/recipe/6981985','브로콜리가 딱 맞게 들어갈 움푹한 그릇을 준비해서 밀가루 1큰술과 굵은소금 1큰술을 넣어 물에 잘 풀어줍니다.-그리고 찬물과 브로콜리를 뒤집어 넣어 20분간 둡니다.-브로콜리는 그냥 씻으면 물이 전부 튕겨져버리고 세척이 안되기 때문에 사이사이 이물질이 그냥 남아 있을 수 있습니다.-번거롭더라도 이 과정을 해야 잔류농약이며 이물질 제거가 됩니다.|| 그리고 브로콜리를 가볍게 헹궈 먹고 좋게 잘라 식초 1큰술 넣어 10분간 담가둡니다.-2중 세척을 하면 정말 깨끗한 브로콜리 섭취가 가능해집니다.|| 끓은 물에 굵은소금 1작은술을 넣고 40초간 데칩니다.|| 데친 브로콜리를 찬물로 여러 번 헹궈 식힙니다.-그리고 브로콜리가 망가지지 않게 조심히 물기를 짜줍니다.|| 두부를 끓은 물에 넣어 1분 데칩니다|| 그리고 깨끗한 면포에 넣어 물기를 제거해 줍니다.|| 물기를 제거한 두부를 예열된 프라이팬에 기름 살짝 두르고 2분 정도 볶아 한 김 식혀줍니다.-이 과정은 생략하고 데친 후 바로 브로콜리랑 무쳐도 충분히 맛있습니다.-볶아주면 남아있던 수분도 더 날려주고 양념이 된 두부가 금방 상하는 걸 방지해줘서 했습니다.|| 볼에 브로콜리랑 두부를 넣고 다진마늘 1작은술, 간장 1큰술, 멸치액젓 1큰술을 넣고 조물조물 무쳐줍니다.|| 그리고 참기름 1스푼과 깨소금을 뿌려 마무리해줍니다.','https://recipe1.ezmember.co.kr/cache/recipe/2022/06/21/eb4d9db8fdd7fd1d1fb2eb718e8609bb1.jpg'),(6983253,NULL,'포만감 가득 다이어트 양배추오믈렛','https://www.10000recipe.com/recipe/6983253','계란, 양배추, 감자, 치즈를 제외하고는-냉장고 파먹기 가능해요.-감자나 치즈도 없으면 생략가능하지만-훨씬 맛이 좋아 필수에 넣었어요.|| 양배추는 식초 넣은 물에 5분 정도 담가두어-잔류농약과 불순물을 제거 세척해요.|| 재료들은 크지 않은 크기로 썰어줘요.-계란으로 덮을 거라 너무 크면-모양내기 힘들어요.-특히 익는데 오래 걸리는 감자는 채를 썰거나 작게 썰어주세요.|| 계란도 잘 풀어주고 소스도 준비했어요.-입맛 따라 소금만 넣어 간을 하거나-하지 않아도 좋아요.|| 재료들과 선택한 소스를 넣고-한번 볶아줘요. 감자가 들었기 때문에-감자가 익을 정도로 볶아요.|| 계란물을 넓게 펴고-아랫부분만 먼저 익혀요.|| 윗부분이 아직 익지 않은 촉촉한 상태의-계란 위에 볶아준 재료들을 올려요.|| 치즈도 올려줘요.|| 계란의 한쪽면을 들어-재료들을 덮고 치즈가 녹을 정도로만-구워주면 완성이예요.','https://recipe1.ezmember.co.kr/cache/recipe/2022/07/11/0b87fd150c33a01e1ebc6a7d32565f441.jpg'),(6992944,NULL,'다이어트 식단 표에 넣기 좋은 원팬 양파 볶음밥','https://www.10000recipe.com/recipe/6992944','팬에 올리브오일 1 큰 술 넣는다. 채 썬 양파 반 개와 슬라이스 마늘 10개 볶는다.-중불|| 갈색빛이 돌 때까지 볶는다. 캐러멜라이징 한다.-센 불에 하면 탈 수 있으니 중약불에서 볶아 준다.|| 간장 1 큰 술을 넣어준다.-간장을 넣으면 불 맛이 나고 간이 맞는다.|| 밥 1.5공기 넣어주고 굴 소스 1 작은 술 넣는다.-굴 소스는 감칠맛을 내기 위함이다. 굴 소스가 없다면 간장을 1 작은 술 추가로 넣는다.|| 양파, 마늘, 양념과 밥이 잘 섞이도록 볶는다. 팬에 넓게 펴주고 마무리한다.|| 계란프라이 1개와 구운 닭 가슴살을 그릇에 올린다.-부침 두부가 있어 1조각 올려 주었다.|| 밥에 깨 약간 후추 약간 뿌려 마무리한다.','https://recipe1.ezmember.co.kr/cache/recipe/2022/11/30/59e2990d72d83f54f47d9f858d6146ff1.jpg'),(6997077,NULL,'양배추오믈렛..','https://www.10000recipe.com/recipe/6997077','계란 3개에 소금 두꼬집을 넣어 풀어요.|| 양배추는 가늘게 채 썰어-계란물에 넣어 섞어요.|| 달궈진팬에 카놀라유 두르고-영배추반죽물을 넣고-모짜렐라치즈를 솔솔 뿌려요.|| 아랫면이 익으면 반으로 접어-약불에서 치즈가 녹을때까지 기다려요.|| 치즈가 녹으면 접시에 담고|| 케첩을 뿌려주면|| 완성 ~!','https://recipe1.ezmember.co.kr/cache/recipe/2023/02/15/ae25d353c17492c998228a5d84c8dc0b1.jpg'),(7004960,NULL,'밀가루 없이 두부도우로 피자만들기, 두부피자','https://www.10000recipe.com/recipe/7004960','두부는(500g) 넓게 잘라 2~3등분 하고 물기를 제거해요.|| 양파는 얇게 채 썰고 방울토마토는 4등분하고 닭가슴살은 결대로 찢어 준비해요.|| 약불로 예열된 팬에 올리브유를 조금 두르고 한 면을 구운 후 뒤집어요.|| 두부 위에 토마토 소스를 2숟가락 올려 펴 발라요.|| 소스 위에 양파, 닭가슴살, 토마토, 모짜렐라 치즈, 파슬리가루 순서로 올려요.-파슬리 가루는 생략 가능하고 바질 가루를 올려줘도 좋아요.|| 뚜껑을 닫고 약불에서 약 5분간 구워 완성해요.','https://recipe1.ezmember.co.kr/cache/recipe/2023/06/29/f95b5d248bae9cd1f50ea853df7cfdf21.jpg'),(7006126,NULL,'두부면 명란 파스타','https://www.10000recipe.com/recipe/7006126','두부면의 충전수는 버리고 흐르는 물에 헹궈주세요.|| 냉동 새우는 탱글탱글한 식감을 위해 소금물에 담가 해동해주세요. 마늘을 도톰하게 편 썰기 해주세요. 명란은 껍질을 벗겨주세요. 명란은 좀 많다 싶을 정도로 넣어야 맛있더라고요. Tip. 만약 명란이 많이 짜면 물에 5분 정도 담가 염분을 빼주세요. 베이컨을 먹기 좋게 잘라주세요.|| 1. 엑스트라 버진 올리브오일을 듬뿍 두르고 마늘을 넣고 중약 불로 볶아주세요. 2. 마늘이 투명해지면 페퍼론치노를 넣어주세요. Tip. 마늘과 페퍼론치노는 쉽게 타므로 요리가 끝날 때까지 중약 불로 조리하세요.-중약불|| 마늘이 노릇해지면 베이컨과 새우를 넣어주세요.|| 새우의 꼬리가 빨갛게 변하면 명란을 넣어주세요.|| 두부면을 넣고 감칠맛을 위해 치즈분말을 넣어주세요.|| 불을 끄고 후추 톡톡 뿌려주세요|| 파슬리가루 톡톡 뿌려주세요|| 명란 파스타를 볼에 담고 쪽파 송송 썰어 올려주면 완성입니다.','https://recipe1.ezmember.co.kr/cache/recipe/2023/07/14/d922226b979585475643318e9b9e6d2c1.jpg'),(7006705,NULL,'알배추 두부참치롤 도리돌돌 말면 한입컷','https://www.10000recipe.com/recipe/7006705','알배추를 삶아줘요. 끓는 물에 약 3분 정도 담가두고 투명해지면 건져 식혀두었어요.-저는 찜기가 없이 간단하게 대치고 싶은 분들은 이렇게 해보세요.|| 두부 반모를 기름기가 없는 팬에 으깨어 수분을 날려줘요.|| 믹싱볼에 참치 반 캔, 수분이 날아간 두부, 그리고 살짝 매콤한 맛을 추가하기 위해 청양고추를 넣어주세요.|| 소금과 후추를 톡톡 넣어 간을 맞춰주세요.|| 알배추 위에 섞어놓은 두부와 참치를 한스푼 넣고 돌돌돌 말아줘요.|| 달걀 두개를 풀어 계란물을 만들어줘요.|| 팬에 기름을 두르고 달구어지면 계란물에 적셔 팬 위에 올려요. 앞뒤로 굽굽하면서 노릇하게 구워지면 그릇 위에 담아줘요.-계란물에 적셔 구워주면 생각보다 배추가 풀어지거나 하지 않아서 쉽게 요리할 수 있어요.|| 완성이에요.','https://recipe1.ezmember.co.kr/cache/recipe/2023/07/24/ddebf135612ea68fcb52b079feb8930d1.jpg'),(7007710,NULL,'두부소보로덮밥 고소해서 자꾸 먹고 싶어지는 맛','https://www.10000recipe.com/recipe/7007710','두부 반모를 기름을 두르지 않은 팬에 올려 으깨주면서 수분을 날려줘요.-불 세기를 강하게 하셔도 좋아요!|| 어느 정도 수분이 날아가면 팬 옆으로 밀어두고 기름을 두르고 파를 볶아 파기름을 내줘요.|| 파와 두부를 섞어 잘 볶아줘요.|| 진간장 두 스푼 넣어주세요.|| 굴소스 한 스푼 넣어주세요.|| 올리고당 한 스푼을 넣어 주세요.|| 현미밥 위에 볶은 두부와 파를 올려주세요.|| 계란 노른자를 가운데에 예쁘게 올려주세요|| 깨 둘러 주세요.|| 들기름을 한 스푼을 둘러주면 완성이에요.','https://recipe1.ezmember.co.kr/cache/recipe/2023/08/09/b8cebd17de07a08ef3e1bd46c03fd2941.jpg'),(7014608,NULL,'10분컷, 아보카도 간장와사비 계란밥','https://www.10000recipe.com/recipe/7014608','아보카도를 반으로 갈라 이쁘게 잘라줍니다.-도마 , 조리용나이프|| 계란 후라이를 만들어 줍니다.-프라이팬 , 뒤집개|| 계란이 맛있게 익는 동안, 간장 2스푼과 와사비 반스푼을 넣고 섞어줍니다.-볼|| 밥 위에 예쁘게 자른 아보카도와 계란후라이를 올리고, 만들어 둔 간장와사비 소스를 부어 줍니다.-완성접시','https://recipe1.ezmember.co.kr/cache/recipe/2023/11/29/b14f9ee042cc52e9e81969c4ed51b93c1.jpg'),(7017649,NULL,'다이어트식으로 딱 알배추 두부말이구이','https://www.10000recipe.com/recipe/7017649','쌈용 알배추를 데쳐주세요-냄비 , 조리주걱|| 부드러워진 배추를 펼치고 두부한줄을 잘라넣고 돌돌 말아주세요-도마 , 조리용나이프|| 말아놓은 배추는 기름을 살짝 두른 후라이팬에 올려서 구워주세요-프라이팬|| 앞뒤를 굽고나면 양념은 발라주세요|| 그릇에 옮겨담으면 끝-완성접시','https://recipe1.ezmember.co.kr/cache/recipe/2024/01/12/050cd27f6cb135578288c9eafe7cf56e1.jpg'),(7017809,NULL,'시금치 계란 볶음 레시피 다이어트 반찬','https://www.10000recipe.com/recipe/7017809','먼저 시금치는 흐르는 물에 깨끗이 씻어줍니다.-채반|| 볼에 계란 4개를 풀어준 후 소금 한 꼬집 넣어 간을 해줍니다.-볼|| 달군 팬에 올리브유를 두르고 계란물을 부어 스크램블 해주세요. 계란이 익기 전에 젓가락으로 마구마구 저어가면서 몽글몽글하게 스크램블 에그를 만들어줍니다. 스크램블 에그는 80% 정도만 익혀주세요.-프라이팬 , 조리용젓가락|| 계란이 80% 로만 익으면 따로 접시에 담아줍니다.-접시|| 이제 다시 팬에 버터와 다진 마늘을 넣고 버터에 마늘을 익혀주세요.-조리용스푼|| 깨끗이 씻어둔 시금치를 모두 넣고 볶아줍니다. 소금 약간 넣고 달달 볶다가 시금치의 숨이 죽으면|| 미리 만들어둔 스크램블 에그를 넣고 살짝만 볶아주면 백종원 시금치볶음 완성입니다.','https://recipe1.ezmember.co.kr/cache/recipe/2024/01/15/539c7609af6d9b9c3bac23ac745db9951.jpg'),(7021091,NULL,'다이어트 반찬 양배추크래미볶음','https://www.10000recipe.com/recipe/7021091','올리브오일 두르고 채썬 당근 먼저 살짝 볶아주세요-도마 , 조리용나이프 , 프라이팬 , 요리스푼|| 채썰어놓은 양배추 넣고 다진마늘 조금, 간장 넣어 간 맞춰주세요 다이어트 중이시라면 아주 살짝만 넣는 게 좋겠지요|| 양배추가 살짝 익으면 찢어놓은 크래미 넣고 후추 살짝 넣어주세요|| 깨 뿌리면 완성이에요','https://recipe1.ezmember.co.kr/cache/recipe/2024/02/29/356c43e0f44a6a5ab005bbf720cd124d1.jpg'),(7025912,NULL,'토마토 달걀볶음/방울토마토','https://www.10000recipe.com/recipe/7025912','방울토마토는 먹기 좋은 크기로 4~5등분 으로 잘라줍니다.-도마 , 조리용나이프-방울토마토 손질법|| 계란 2개에 소금 반 꼬집,후추 톡톡 넣고 잘 풀어줍니다.-대접 , 요리젓가락|| 예열된 팬에 기름 두르고 풀어둔 계란을 넣어줍니다.-프라이팬|| 계란의 가장자리가 익을 때 쯤 조리용 젓가 락으로 휘휘저어서 스크 램블을 만들어요.|| 중약불로 적당히 몽글 몽글 익혀줍니다.70~80% 정도 익혀줍니다.나중에 토마토와 한번 더 볶을 거 니까 너무 익히면 안되요. 스크램블은 따로 그릇에 옮겨둡니다.-접시|| 후라이팬에 기름 두르고 방울토마토를 볶아줍니다.|| 여기에 다진마늘1/3T, 다진파1/2T,를 넣고 아 까 만든 스크램블과 같이 볶아줍니다.마무리 간은 간장1/3T만 넣고 재빠르 게 한 번 더 볶아주면 완성됩니다.|| 토마토 달걀볶음 완성 됐어요.토마토의 식감은 취향에 맞게 익혀줍니다.|| 그냥 먹어도 충분하지만 조금 아쉽다면 토스트에 올려 먹어도 맛있어요.','https://recipe1.ezmember.co.kr/cache/recipe/2024/05/08/93819677da57219a5ef609ef52f164851.jpg'),(7027794,NULL,'입맛 없는 여름에 딱 좋은 한 끼! 오이고추 비빔밥','https://www.10000recipe.com/recipe/7027794','밥은 현미밥을 사용했는데 기호에 따라 선택 가능해요^^|| 분량의 양념재료를 섞어요.-유리볼 , 조리용스푼-[된장 1T, 들기름 2t, 다진마늘 1t, 매실청 1t, 식초 1t]|| 만든 양념에 오이고추를 가위로 송송 썰어 넣어 양념과 버무려요.-조리용가위|| 참치는 물기를 짜서 준비해요.|| 그릇에 현미밥>오이고추>참치 순서로 올려요.-샐러드볼|| 김가루와 깨를 뿌려 완성해요.','https://recipe1.ezmember.co.kr/cache/recipe/2024/06/07/a969f7cb0d9a648fc26cfd248bab4a9b1.jpg'),(7045377,NULL,'라이스페이퍼 양배추만두','https://www.10000recipe.com/recipe/7045377','양배추는 잘게 채 썰어요.-나무도마 , 조리용나이프|| 참치는 기름을 빼서 준비해요.-찬기 , 숟가락|| 팬에 기름을 두르고 양배추를 볶아요.|| 양배추 숨이 죽으면 옆쪽으로 밀어두고 달걀을 볶아요.-프라이팬 , 조리주걱|| 달걀이 익으면 양배추와 함께 섞어 볶아요.|| 참치와 굴소스, 간장을 넣어 볶아요.-간장은 가장자리에 넣어 살짝 볶아 섞어요.|| 미지근한 물에 적신 라이스페이퍼 위에 볶아둔 양배추를 한스푼씩 넣어 말아요.-2번 말아주면 더 쫄깃하고 맛있어요.|| 기름을 두른 팬에 노릇하게 구워요.|| 초간장과 곁들여 완성해요.-접시','https://recipe1.ezmember.co.kr/cache/recipe/2025/02/19/289273586ce52c702ff61dd4bdee68fa1.jpg'),(7045536,NULL,'<다이어트 건강식> 초간단 양배추 닭가슴살 덮밥','https://www.10000recipe.com/recipe/7045536','양배추는 심지 제거 후 채 썰어서 물에 담갔다가 흐르는 물에 씻은 후 체에 받쳐서 물기 빼 주세요.-도마 , 조리용나이프 , 믹싱볼 , 채반-양배추 손질법|| 닭가슴살은 고기 결대로 어슷썰기.|| .올리브유 1큰술 두르고, 다진 마늘 1큰술 넣어 중간 불에서 볶아준다.-볶음팬 , 요리스푼|| 양파 반개 채썰어서 같이 넣고 빠르게 볶아준다.|| 양배추는 물기 제거 후에 넣고 같이 볶아준다. (이떄 강불에서 빠르게 )-양배추 손질법|| 양배추가 어느 정도 숨이 죽으면 썰어 둔 닭가슴살도 넣고 같이 볶는다.|| 굴소스 반스푼, 진간장 한스푼, 참치액 반스푼, 올리고당 반스푼(생략 가능)을 넣고 강불에서 재료들을 골고루 섞어가며 볶아준다.|| 양념들이 재료에 골고루 섞였으면 가운데 공간을 만든 후에 달걀 프라이를 만들어 준다.|| 밥 위에 예쁘게 담아 파슬리 가루 솔솔 뿌려서 맛있게 드세요~~~^^ (기호에 따라 참깨나 고춧가루도 상관 없어요)-완성그릇','https://recipe1.ezmember.co.kr/cache/recipe/2025/02/20/a8ecdfeb81d4ba604c2ca7a3c7bddf601.jpg'),(7045621,NULL,'<다이어트 건강식>초간단 참치 비빔밥','https://www.10000recipe.com/recipe/7045621','다이어트 건강식이라 쌀에 \'파로\' 30%를 넣고 밥을 했어요! (현미 대체 가능)|| 씹히는 식감도 맛있고, 고소해요~ 혈당 관리에도 좋고 식이섬유가 풍부해서 체중 감량에 도움을 준답니다^^-면기|| 상추 5장 깨끗이 씻어 놓기. (기호에 따라 상추 양은 조절 하세요)|| 사조 생생 참치캔인데 덩어리로 들어 있어요~ 이거 강추!|| 이렇게 참지살이 그대로 살려져 있어서 특히 비빔밥에 넣어 먹을 때 더욱 맛있어요!|| 상추는 가위로 잘라서 밥 위에 올려 놓고, 고추장과 참기름 준비해서 기호에 따라 양 조절해 넣으세요~-조리용가위 , 소스볼 , 스푼|| 달걀 프라이 해서 밥위에 얻으시면 완성!! 정말 간단하죠?!^^ 맛도 최고!! 영양도 최고!!','https://recipe1.ezmember.co.kr/cache/recipe/2025/02/21/b4756ab10597b0faf1ff566eec18f6591.jpg'),(7046139,NULL,'<다이어트 건강식>초간단 두부 치즈 그라탕!!','https://www.10000recipe.com/recipe/7046139','두부 반모를 잘라서 흐르는 물에 씻어 놓기.|| 물기 제거 후 넓은 그릇( 평소 국수 담는 크기 그릇)에 담아 포크로 두부 으깨기.-면기 , 포크|| 양파 반개를 잘게 썰어서 으깬 두부 위에 올려준다.-도마 , 조리용나이프|| 토마토 파스타 소스 5스푼을 골고루 발라준다. (저는 오뚜기 토마토 파스타 소스를 사용 했어요!/ 시중에 파는 토마토 소스는 기본 소금, 후추 간이 되어 있어서 따로 간을 하지 않아도 됨! 혹시 100% 토마토 퓨레를 사용할 경우 후추와 소금 한 꼬집씩 넣기!)|| 그 위에 모짜렐라 치즈(70g)를 골고루 뿌려준다. (기호에 따라 더 넣으셔도 되세요.)|| 랩을 씌운 후, 포크로 듬성듬성 3~4번 찔러서 전자레인지에 5분 돌려준다.-위생랩 , 포크 , 전자레인지|| 초간단 영양만점 \'두부 치즈 그라탕\' 완성!!!','https://recipe1.ezmember.co.kr/cache/recipe/2025/02/27/597802d30f5795a0a19a5502d4f849351.jpg'),(7046232,NULL,'<다이어트 건강식>초간단 순두부 계란찜','https://www.10000recipe.com/recipe/7046232','순두부 포장 부분 물로 깨끗이 씻어 주세요.|| 파는 초록색 부분을 깨끗이 물에 세척 후, 가위로 잘게 잘라 주세요.(대파나 쪽파 다 상관없음)-접시 , 조리용가위|| 실리콘 냄비(계란찜용 사이즈)에 계란 2알을 넣고,섞어 주세요.(실리콘 냄비가 없으실 경우 전자레인지 사용 가능한 용기을 사용해 주세요.)-전자레인지용기|| 순두부 1팩을 잘라서 계란 섞은 물에 담아 주세요. (순두부 팩 로고 기준으로 아래쪽 양쪽 모서리 끝을 가위로 자른 후 공기가 빠지면 가로로 길게 가위로 잘라 주세요. 이렇게 하면 한 번에 쉽게 순두부를 꺼낼 수 있어요. 순두부 모양이 망가져도 상관 없어요!)|| 참기름과 참치액을 각각 1큰술씩 넣고, 잘 섞어 주세요.-스푼|| 그리고 잘게 썰어 놓은 파를 넣은 후, 뚜껑 닫고 전자레인지에 7~8분 조리.-전자레인지|| 쨘~! 맛과 영양 가득한 순두부 계란찜이 완성!!! 다이어트시 한 끼 식사로 든든해요~강추!!!','https://recipe1.ezmember.co.kr/cache/recipe/2025/02/28/4c823434b94bd74b14e82cbe31649bdd1.jpg'),(7052506,NULL,'레드벨벳 슬기님의 컴백 전 관리비결!','https://www.10000recipe.com/recipe/7052506','두부 반 모 노릇하게 구워서 접시에 올려주세요-도마 , 조리용나이프 , 프라이팬 , 접시|| 팽이버섯 반 봉지 구워주다가-프라이팬 , 조리용스푼-팽이버섯손질법|| 진간장1T, 알룰로스1T, 굴소스0.5T, 다진마늘1T, 물2T 섞어서 소스만들어 부워 졸여주세요|| 두부 위에 올려주면 끝!','https://recipe1.ezmember.co.kr/cache/recipe/2025/05/12/ddc7435df7bf81f8c955e50e998f53c91.jpg'),(7054279,NULL,'[두부계란덮밥] 두부를 이용한 건강한 다이어트 밥상','https://www.10000recipe.com/recipe/7054279','두부 1모는 먹기 좋은 크기로 잘라주신 후-도마 , 조리용나이프|| 키친타올로 물기를 제거해주세요~-키친타올|| 웍에 기름을 두른 후-웍|| 두부를 구워주시는 동안 양념을 준비해볼게요~|| 스테비아 1/2T 넣어주세요~-소스볼 , 숟가락|| 굴소스 2 T|| 간장 2T|| 물 2T|| 청양고추 조금을 넣고 섞어주세요~|| 계란 2개는 미리 풀어놔주세요~|| 두부가 어느정도 익었다 싶으면 풀어놓은 계란을 부어주시고|| 만들어놓은 양념을 부어주시고|| 볶아주세요~!!-요리스푼|| 다 볶았으면 밥 위에 두부계란을 올려주시고-접시|| 들기름 조금에 깨까지 넣어주면|| 진짜 맛있는 \'두부계란덮밥\'이 완성~! 감칠맛에 단백질도 가득들어가 있고 중독적인 맛이여서 자주 먹고 있어요~~!','https://recipe1.ezmember.co.kr/cache/recipe/2025/06/02/061af59a1677b01594d2fad037247a6b1.jpg');
